import logo from './logo.svg';
import './App.css';

function App() {
  let name = "Saurabh"
  return (
    <>
    <div className="navigation">
      <ol>
        <li>Butcher</li>
        <li>M.M.</li>
        <li>Frenchie</li>
        <li>Kimiko</li>
        <li>Hughie</li>
        <li>Annie</li>
        <li>
          {name}
        </li>
      </ol>
    </div>
    </>
  );
}

export default App;
